import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';
import TodoItems from './TodoItems.js'
import ContactCard from './ContactCard';


// function App() {
//     return(
//         <div className="todo">
//             <TodoItems />
//             <TodoItems />
//             <TodoItems />
//             <TodoItems />
//         </div>
//     );
// }

function App1() {
    return(
        <div>
            <ContactCard name="superman" phone="12" email="@superman"/>
            <ContactCard name="spiderman" phone="34" email="@spiderman"/>
            <ContactCard name="batman" phone="56" email="@batmna"/>
            <ContactCard name="ironman" phone="78" email="@superman"/>
        </div>
    );
}


ReactDOM.render(<App1 />, document.getElementById('root'));
